import React from 'react';
import {
    Grid,
    Typography
} from "@material-ui/core";

const ProjectList = () => {
    return (
        <Grid container direction="column" justify="center" alignItems="center">
            <Typography variant="h2">Projects</Typography>
        </Grid>
    );
}

export default ProjectList;
